webpackJsonp([0xe6351c7f0ffe],{699:function(i,t){i.exports={data:{markdownRemark:{html:'<p>When you decline an invitation to a private program or leave a private program, you\'ll be placed at the top of the invitation queue for a new program invitation.</p>\n<h4>How It Works</h4>\n<p>To be placed in the invitations priority queue:</p>\n<ol>\n<li>Decline an invitation or leave a program you\'re currently part of.</li>\n<li>Fill out the questionnaire telling why the program wasn\'t a good fit. The questionnaire will immediately display on your screen after declining or leaving.</li>\n</ol>\n<p>You\'ll see a green banner on your <strong>Pending Invitations</strong> page letting you know that you\'re slotted for the next appropriate invitation.</p>\n<p>   \n  <a\n    class="gatsby-resp-image-link"\n    href="/static/priority-invitations-1-6af7c09a41d4457a41ca02b01b45347a-8e881.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 33.35987261146497%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="priority-invitations-1"\n        title=""\n        src="/static/priority-invitations-1-6af7c09a41d4457a41ca02b01b45347a-2f183.png"\n        srcset="/static/priority-invitations-1-6af7c09a41d4457a41ca02b01b45347a-67829.png 125w,\n/static/priority-invitations-1-6af7c09a41d4457a41ca02b01b45347a-5c59f.png 250w,\n/static/priority-invitations-1-6af7c09a41d4457a41ca02b01b45347a-2f183.png 500w,\n/static/priority-invitations-1-6af7c09a41d4457a41ca02b01b45347a-c93e8.png 750w,\n/static/priority-invitations-1-6af7c09a41d4457a41ca02b01b45347a-4e628.png 1000w,\n/static/priority-invitations-1-6af7c09a41d4457a41ca02b01b45347a-8e881.png 1256w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The timeframe for getting a new invitation is based on the number of programs looking for hackers, which is also dependent on the number of programs that have been rejected or left.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/priority-invitations-2-b6a3e00e35cd2685152d1fbc8f2d3651-2933d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 50.418410041841%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="priority-invitations-2"\n        title=""\n        src="/static/priority-invitations-2-b6a3e00e35cd2685152d1fbc8f2d3651-2f183.png"\n        srcset="/static/priority-invitations-2-b6a3e00e35cd2685152d1fbc8f2d3651-67829.png 125w,\n/static/priority-invitations-2-b6a3e00e35cd2685152d1fbc8f2d3651-5c59f.png 250w,\n/static/priority-invitations-2-b6a3e00e35cd2685152d1fbc8f2d3651-2f183.png 500w,\n/static/priority-invitations-2-b6a3e00e35cd2685152d1fbc8f2d3651-c93e8.png 750w,\n/static/priority-invitations-2-b6a3e00e35cd2685152d1fbc8f2d3651-4e628.png 1000w,\n/static/priority-invitations-2-b6a3e00e35cd2685152d1fbc8f2d3651-2933d.png 1434w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Some things to keep in mind are that: </p>\n<ul>\n<li>You can only receive 1 priority invitation per day.</li>\n<li>For each original private invitation or program you decline, you have a total of 3 chances to receive a priority invitation that you like. You won\'t receive an invitation after you get your 3rd priority invitation for that original invitation or program you\'ve declined.</li>\n</ul>',frontmatter:{title:"Invitations Priority Queue",id:"hackers/invitations-priority-queue",path:"/hackers/invitations-priority-queue.html",description:null}}},pathContext:{}}}});
